window.bookSummaryJSON = "<p>Saddle up and join the original cast of <i>Wynonna Earp</i> on an immersive new audio adventure in the gritty supernatural world of Purgatory.</p> <p><b>Please note: This content is intended for adults only. It contains explicit language, sexual references, and adult themes. Discretion is advised.</b></p> <p>Saddle up and join <i>Wynonna Earp</i> on an immersive new audio adventure in the gritty supernatural world of Purgatory. This Audible Original invites you deeper into the Weird West to follow Wynonna Earp (Melanie Scrofano), as she embarks on her craziest adventure yet: riding off into the sunset with her soulmate, Doc Holliday (Tim Rozon)—yes ... that Doc Holliday. Brace yourself for more wise-cracking demon hunters, earth-shattering revelations and all the genre-blending action you've come to expect from the cult hit TV series. With Waverly (Dom Provost-Chalkley), Sheriff Nicole Haught (Katherine Barrell), Jeremy (Varun Saranga), Mercedes (Dani Kind) and more, these latest tales from Purgatory will navigate a happily-ever-after that’s much more complicated than they expected! Don't miss out on this essential new installment for fans craving another dose of badass demon-fighting mayhem.</p> <p>Now in Dolby Atmos on Audible.</p>"; 
